import { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";
import './Dashboard.css';
import Upload from "./Upload";
import Library from "./Library";

function Dashboard() {

    const [values, setValues] = useState();
    const [tabValue, setTabValue] = useState();
    const navigate = useNavigate();
    useEffect(
        () => {
            fetch("http://localhost:3333"+"/dashboard", {
                method: "POST",
                credentials: "include",
                headers: {
                    "Content-Type" : "application/json"
                }
            })
            .then(res => res.json())
            // .then(res => console.log(res))
            .then(res => setValues(JSON.stringify(res)))
            .catch(()=> {
                navigate('/')
            })
        }, []
    );

    const onTabClick = (value) => {
        console.log(value)
        setTabValue(value)
    }

    const renderTabs = (tabValue) => {
        switch(tabValue)
        {
            case "library":
                return <Library></Library>;
            case "upload":
                return <Upload></Upload>;
            default:
                return <Library></Library>;
        }
    }

    return (
        <div class="wrapper">
        <nav id="sidebar">
            <div class="sidebar-header">
                <h3>Galleria</h3>
            </div>

            <ul class="list-unstyled components">
                
                <li>
                    <a href="#" onClick={() => onTabClick("library")}>Library</a>
                </li>
                <li>
                    <a href="#" onClick={() => onTabClick("favourites")}>Favourites</a>
                </li>
                <li>
                    <a href="#" onClick={() => onTabClick("upload")}>Upload Image</a>
                </li>
                <li>
                    <a href="#">Logout</a>
                </li>
            </ul>
        </nav>

        <div id="content">
            
            {
                () => renderTabs(tabValue)
            }
        </div>
    </div>
    )
}
export default Dashboard;
